import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Home = () => {
  const token = localStorage.getItem('token');
  console.log(token);

  // Estado para almacenar la lista de usuarios
  const [users, setUsers] = useState([]);

  // Función para obtener los usuarios desde el API
  const fetchUsers = async () => {
    try {
      const response = await axios.get(
        'https://ujed-api.onrender.com/api/users?order_by=created_at&order=desc&limit=5',
        {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        }
      );
      setUsers(response.data);
    } catch (error) {
      console.error('Error al obtener usuarios:', error);
    }
  };

  // Llamamos a fetchUsers al cargar el componente
  useEffect(() => {
    fetchUsers();
  }, []); // La lista de dependencias vacía asegura que se ejecute solo una vez al montar el componente

  return (
    <div className="dashboard-container">
      <h1>Dashboard</h1>
      <div className="user-list">
        <h2>Lista de Usuarios</h2>
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Nombre</th>
              <th>Apellido</th>
              <th>Email</th>
              <th>Roles</th>
              <th>Creado</th>
              <th>Actualizado</th>
            </tr>
          </thead>
          <tbody>
            {users.map(user => (
              <tr key={user.id}>
                <td>{user.id}</td>
                <td>{user.name}</td>
                <td>{user.last_name}</td>
                <td>{user.email}</td>
                <td>{user.roles.join(', ')}</td>
                <td>{new Date(user.created_at).toLocaleString()}</td>
                <td>{new Date(user.updated_at).toLocaleString()}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Home;
